import * as ReactDOM from "react-dom";
import {useHistory} from "react-router";
import InfoBox from "./InfoBox";

const StudentList=(props)=>
{

    const handleShow =(id)=>
    {
        useHistory().go(<InfoBox id = {id}/>)
    }

    return(
        <table>
            <thead>
            <tr>
                <th> Name</th>
                <th> Surname</th>
                <th> ID Number</th>
                <th>Risk Status</th>
            </tr>
            </thead>
            <tbody>
            {props.data &&
            props.data.map((student) => {
                return (
                    <>
                        <tr>
                            <td>{student.name}</td>
                            <td>{student.surname}</td>
                            <td>{student.id}</td>
                            <td>{student.allowedOnCampus}</td>
                            <td><button onClick={()=>handleShow(student.id)} >show</button> </td>
                        </tr>
                    </>
                )
            })}
            </tbody>
        </table>
    )

}
export default StudentList
